import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Catalog from './pages/Catalog/Catalog';
import Main from "./pages/Main/Main";
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import { CtgList } from './pages/Catalog/CtgList';
import CatalogItem from './components/CatalogItem/CatalogItem';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App>
        <Routes>
          <Route path="/" element={<Main />} exact/>
          <Route path="/catalog" element={<Catalog />} exact/>
          {CtgList.map(({link, title, img, description}, index) => {
            return(
              <Route key={index} path={link} element={<CatalogItem title={title} description={description} img={img} />} exact/>
            )
          })}
        </Routes>
      </App>
    </BrowserRouter>

  </React.StrictMode>
);
